import { AbstractControl } from '@angular/forms';

@Pipe({
  name: 'isInvalid',
  standalone: true,
  pure: false
})
export class IsInvalidPipe implements PipeTransform {

  transform(control: AbstractControl, ...keys: string[]): boolean {
    return control?.touched && !!control?.errors;
  }

