.ef-form-wrap-input {

    .wrap-input {
        position: relative;

        &__fieldset {
            padding: 5px;
            border: 1.5px solid var(--color-dark-secondary);
            height: 85px;
            margin-inline-start: 5px;
            margin-inline-end: 5px;
            padding-inline-start: 15px;

            &::before {
                content: " ";
                background-color: transparent;
                border: 1.5px solid var(--color-white);
                width: calc(100% - 23px);
                height: 85px;
                position: absolute;
                display: block;
                top: 5px;
                right: 0px;
                left: 10px;
                bottom: 0;
                z-index: -1;
                filter: drop-shadow(0px 4px 4px rgba(0, 0, 0, 0.25));
                transition: var(--transition-bezier);

            }
        }

        &__label {
            font-size: var(--font-size-lg);
            font-family: "Besley";
            text-transform: capitalize;
            position: absolute;
            padding-inline-start: 5px;
            padding-inline-end: 5px;
            z-index: 1;
            color: var(--color-white);
            transition: var(--transition-bezier);
            top: 50%;
            transform: translateY(-50%);


            &::after {
                content: "";
                position: absolute;
                width: 100%;
                height: 50%;
                bottom: 0;
                left: 0;
                background-color: #525356;
                z-index: -1;
            }
        }

        &__icon {
            position: relative;
            top: -3.5rem;
            right: -90%;
            cursor: pointer;
        }

        &__error {
            font-size: var(--font-size-sm);
            padding-left: 1.5rem;
            color: var(--color-error);
            display: none;
            position: relative;
        }

        &__warning {
            font-size: var(--font-size-sm);
            padding-left: 1.5rem;
            color: var(--color-warning);
            display: none;
            position: relative;
        }

        &__success{
            font-size: var(--font-size-sm);
            padding-left: 1.5rem;
            color: var(--color-success);
            display: none;
            position: relative;
        }

        &--invalid {
            & .wrap-input__error {
                display: block;
            }

            .wrap-input__label {
                top: 0;
                transform: none;
                font-size: var(--font-size-sm);
                position: relative;
            }

            .wrap-input__fieldset {
                &::before {
                    top: 19px;
                    height: 70px;
                }
            }
        }

        &--filled.wrap-input--focus:not(.wrap-input--invalid) {
            & .wrap-input__warning {
                display: block;
            }

            .wrap-input__label {
                top: 0;
                transform: none;
                font-size: var(--font-size-sm);
                position: relative;
            }

            .wrap-input__fieldset {
                &::before {
                    top: 19px;
                    height: 70px;
                }
            }
        }

        &--filled:not(.wrap-input--focus):not(.wrap-input--invalid) {
            & .wrap-input__success {
                display: block;
            }

            .wrap-input__label {
                top: 0;
                transform: none;
                font-size: var(--font-size-sm);
                position: relative;
            }

            .wrap-input__fieldset {
                &::before {
                    top: 19px;
                    height: 70px;
                }
            }
        }


        &--focus, &--filled {
            .wrap-input__label {
                top: 0;
                transform: none;
                font-size: var(--font-size-sm);
                position: relative;
            }

            .wrap-input__fieldset {
                &::before {
                    top: 19px;
                    height: 70px;
                }
            }
        }
    }
}

.ef-form-wrap-open {

    &--no-options {
        .wrap-input {
            &__fieldset {
                height: auto;
    
                &::before {
                    height: calc(100% - 36px) !important;
                }
            }
        }
    }
    .wrap-input {
        &__fieldset {
            height: auto;

            &::before {
                height: calc(100% - 61.5px) !important;
            }
        }
    }
}

